def validate_metadata(metadata):
    """
    Validate image metadata based on the ImageData model requirements.
    
    Args:
        metadata (dict): Dictionary containing image metadata fields
        
    Returns:
        tuple: (is_valid: bool, errors: list)
    """
    errors = []
    
    # Required fields
    if not metadata.get("tc_image_id"):
        errors.append("tc_image_id is required")
    elif not isinstance(metadata["tc_image_id"], str):
        errors.append("tc_image_id must be a string")
    elif len(metadata["tc_image_id"]) > 255:
        errors.append("tc_image_id must be 255 characters or less")
    
    if not metadata.get("raw_image_path"):
        errors.append("raw_image_path is required")
    elif not isinstance(metadata["raw_image_path"], str):
        errors.append("raw_image_path must be a string")
    elif len(metadata["raw_image_path"]) > 500:
        errors.append("raw_image_path must be 500 characters or less")
    
    # Optional fields - validate if present
    if "processed_image_path" in metadata and metadata["processed_image_path"] is not None:
        if not isinstance(metadata["processed_image_path"], str):
            errors.append("processed_image_path must be a string")
        elif len(metadata["processed_image_path"]) > 500:
            errors.append("processed_image_path must be 500 characters or less")
    
    if "histogram_path" in metadata and metadata["histogram_path"] is not None:
        if not isinstance(metadata["histogram_path"], str):
            errors.append("histogram_path must be a string")
        elif len(metadata["histogram_path"]) > 500:
            errors.append("histogram_path must be 500 characters or less")
    
    if "intensity_average" in metadata and metadata["intensity_average"] is not None:
        if not isinstance(metadata["intensity_average"], (int, float)):
            errors.append("intensity_average must be a number")
    
    if "focus_score" in metadata and metadata["focus_score"] is not None:
        if not isinstance(metadata["focus_score"], (int, float)):
            errors.append("focus_score must be a number")
        elif not 0 <= metadata["focus_score"] <= 1:
            errors.append("focus_score must be between 0 and 1")
    
    if "classification_label" in metadata and metadata["classification_label"] is not None:
        if not isinstance(metadata["classification_label"], str):
            errors.append("classification_label must be a string")
        elif len(metadata["classification_label"]) > 255:
            errors.append("classification_label must be 255 characters or less")
    
    return len(errors) == 0, errors

